INSERT INTO `posts` VALUES (1, 'Cần cho thuê Chung cư tại Lê Duẩn, Sơn Tây', 'Animadverto velut sequi odit reprehenderit careo valde aliquid vis. Summa ullus ascisco. Temperantia facilis vorax articulus deficio ceno tergiversatio bibo auxilium. Vị trí đắc địa, gần trường học. Celebrer ad alii avaritia officia vespillo torqueo. Vicinus pectus cado expedita aliqua tredecim magni cauda soleo.', '288 Lê Duẩn, Phường Láng Hạ', 'Phường Láng Hạ, Sơn Tây, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=01\",\"https://picsum.photos/800/600?random=02\",\"https://picsum.photos/800/600?random=03\"]', 'approved', 'Chưa bàn giao', 3, 847, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (2, 'Bán Chung cư tại Láng Hạ, Hoàn Kiếm', 'Censura molestias viduo repudiandae utilis veniam pectus. Tabula sursum aperiam stipes vilicus amo celer eligendi tunc. Crustulum calcar defleo delinquo comburo paens nulla strenuus vita minima. Vị trí đắc địa, gần bệnh viện. Sodalitas conicio vero. Arbor sui cuppedia textus.', '37 Láng Hạ, Phường Giảng Võ', 'Phường Giảng Võ, Hoàn Kiếm, Hà Nội', 'sell', '[\"https://picsum.photos/800/600?random=11\",\"https://picsum.photos/800/600?random=12\",\"https://picsum.photos/800/600?random=13\"]', 'approved', 'Chưa bàn giao', 3, 1293, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (3, 'Cần bán Chung cư tại Giải Phóng, Nam Từ Liêm', 'Uberrime nobis canonicus coadunatio creo cuppedia vir coma aestas. Careo trucido terminatio patrocinor thorax cinis verto succurro. Truculenter aranea accedo arguo curso tener. Vị trí đắc địa, gần trung tâm thương mại. Numquam aestus abeo. Vulariter auctor tribuo teres audio.', '12 Giải Phóng, Phường 5', 'Phường 5, Nam Từ Liêm, Hà Nội', 'sell', '[\"https://picsum.photos/800/600?random=21\",\"https://picsum.photos/800/600?random=22\",\"https://picsum.photos/800/600?random=23\"]', 'approved', 'Đã bàn giao', 6, 1590, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (4, 'Cho thuê Chung cư tại Phạm Văn Đồng, Ba Đình', 'Impedit desparatus tempore cenaculum cado vicissitudo inflammatio aegrus bellicus auctor. Tardus veritas celebrer vilicus alias uberrime accendo adsum sponte vomica. Facere calamitas astrum paulatim victus ullam enim. Vị trí đắc địa, gần công viên. Sapiente tego usitas explicabo ubi impedit capto. Delibero tamen iusto avaritia denego omnis maiores sursum.', '21 Phạm Văn Đồng, Phường Giảng Võ', 'Phường Giảng Võ, Ba Đình, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=31\",\"https://picsum.photos/800/600?random=32\",\"https://picsum.photos/800/600?random=33\"]', 'approved', 'Đã bàn giao', 2, 1633, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (5, 'Cần cho thuê Chung cư tại Xuân Thủy, Nam Từ Liêm', 'Demitto terminatio adeo. Tactus desidero tristis aeger modi comitatus. Bos agnosco verbera comes thema cupressus. Vị trí đắc địa, gần công viên. At vulnero bibo titulus velit verecundia cerno. Suppellex tunc quod tenuis.', '312 Xuân Thủy, Phường Láng Thượng', 'Phường Láng Thượng, Nam Từ Liêm, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=41\",\"https://picsum.photos/800/600?random=42\",\"https://picsum.photos/800/600?random=43\"]', 'approved', 'Chưa bàn giao', 7, 1363, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (6, 'Cần bán Chung cư tại Nguyễn Chí Thanh, Long Biên', 'Modi totam verbum convoco cognatus occaecati tum stella ullam. Statua aliqua stips. Dolore vesica volubilis crepusculum arbustum suadeo abstergo caritas. Vị trí đắc địa, gần siêu thị. Earum capillus illo arbitro deleniti atque armarium annus thema taceo. Sono vitiosus deputo texo amplexus minima accommodo.', '410 Nguyễn Chí Thanh, Phường 1', 'Phường 1, Long Biên, Hà Nội', 'sell', '[\"https://picsum.photos/800/600?random=51\",\"https://picsum.photos/800/600?random=52\",\"https://picsum.photos/800/600?random=53\"]', 'approved', 'Chưa bàn giao', 4, 1226, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (7, 'Cần cho thuê Chung cư tại Phạm Văn Đồng, Hoàng Mai', 'Spargo cinis quo delicate. Quia titulus vindico summopere suppellex. Vulnero traho aperio calamitas texo. Vị trí đắc địa, gần siêu thị. Comptus aliquid depopulo appono. Cultura agnitio virtus velum argentum.', '309 Phạm Văn Đồng, Phường 1', 'Phường 1, Hoàng Mai, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=61\",\"https://picsum.photos/800/600?random=62\",\"https://picsum.photos/800/600?random=63\"]', 'rejected', 'Chưa bàn giao', 6, 1484, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (8, 'Bán Chung cư tại Trần Duy Hưng, Đông Anh', 'Dolorem deinde utrimque cado vestrum usitas turbo consectetur. Arguo titulus pecto addo argentum cumque cauda baiulus cavus. Vinitor bardus adduco asperiores teres verumtamen commodi aequitas cedo amissio. Vị trí đắc địa, gần trung tâm thương mại. Tepesco tutis tandem. Laborum decretum carus.', '426 Trần Duy Hưng, Phường Trung Tự', 'Phường Trung Tự, Đông Anh, Hà Nội', 'sell', '[\"https://picsum.photos/800/600?random=71\",\"https://picsum.photos/800/600?random=72\",\"https://picsum.photos/800/600?random=73\"]', 'pending', 'Đã bàn giao', 3, 672, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (9, 'Cần cho thuê Chung cư tại Xuân Thủy, Gia Lâm', 'Inventore hic adfero cunabula quidem quas conspergo paens. Aurum vesco decens acervus ultra tamisium cado debilito ulterius ipsum. Vester desparatus cribro. Vị trí đắc địa, gần công viên. Consequuntur asper speciosus creber at demoror cupressus sublime comparo rem. Bellicus triumphus ventito sapiente cunae accusamus adstringo pauper aveho.', '106 Xuân Thủy, Phường Láng Thượng', 'Phường Láng Thượng, Gia Lâm, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=81\",\"https://picsum.photos/800/600?random=82\",\"https://picsum.photos/800/600?random=83\"]', 'approved', 'Đã bàn giao', 6, 1391, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (10, 'Cần cho thuê Chung cư tại Phạm Văn Đồng, Gia Lâm', 'Decens comprehendo argentum capillus cupiditas aspicio coerceo. Vaco aveho cunabula subvenio celo uterque adopto magnam tui. Canto coepi velit illum complectus. Vị trí đắc địa, gần trung tâm thương mại. Uberrime degenero dignissimos. Bonus adinventitias vulnero caelum id vinculum.', '132 Phạm Văn Đồng, Phường Trung Tự', 'Phường Trung Tự, Gia Lâm, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=91\",\"https://picsum.photos/800/600?random=92\",\"https://picsum.photos/800/600?random=93\"]', 'approved', 'Chưa bàn giao', 4, 276, 'agent', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (11, 'Cho thuê Chung cư tại Xuân Thủy, Thanh Xuân', 'Paulatim collum alioqui tametsi conspergo. Aequitas vilis dolore tempore avarus reiciendis argumentum ventito tam adeo. Recusandae attollo decens. Vị trí đắc địa, gần siêu thị. Vesper spectaculum absum vado. Antea cultura tener colo ut defero ustulo versus.', '346 Xuân Thủy, Phường 2', 'Phường 2, Thanh Xuân, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=101\",\"https://picsum.photos/800/600?random=102\",\"https://picsum.photos/800/600?random=103\"]', 'approved', 'Đã bàn giao', 5, 1354, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (12, 'Bán Chung cư tại Giải Phóng, Hoàng Mai', 'Turba quia sumptus utor avarus admiratio temperantia odio suggero. Administratio vos cattus. Aestas conculco ipsum ex atrocitas tertius undique tripudio explicabo. Vị trí đắc địa, gần siêu thị. Cenaculum conscendo tumultus solio arto amicitia vehemens. Timidus vulgo verumtamen doloremque tutis arx tremo antepono.', '199 Giải Phóng, Phường Ngọc Khánh', 'Phường Ngọc Khánh, Hoàng Mai, Hà Nội', 'sell', '[\"https://picsum.photos/800/600?random=111\",\"https://picsum.photos/800/600?random=112\",\"https://picsum.photos/800/600?random=113\"]', 'rejected', 'Chưa bàn giao', 6, 1142, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (13, 'Cần cho thuê Chung cư tại Xã Đàn, Nam Từ Liêm', 'Demum solium eveniet tollo clamo a civis. Vere surculus terminatio derideo. Victoria adsum culpa. Vị trí đắc địa, gần bệnh viện. Comprehendo summisse ventosus catena collum. Confugo timor quo ratione aeneus.', '259 Xã Đàn, Phường Ngọc Khánh', 'Phường Ngọc Khánh, Nam Từ Liêm, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=121\",\"https://picsum.photos/800/600?random=122\",\"https://picsum.photos/800/600?random=123\"]', 'approved', 'Đã bàn giao', 7, 1443, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (14, 'Bán Chung cư tại Tôn Đức Thắng, Thanh Xuân', 'Crudelis coaegresco sumo tamisium tergeo ancilla vitae cimentarius vindico vaco. Vulariter nisi quam recusandae damnatio. Patria rem umerus curvo audentia adfero caelestis contigo xiphias. Vị trí đắc địa, gần bệnh viện. Officia pectus paens confugo soleo tristis. Venustas comptus demo virtus conculco.', '184 Tôn Đức Thắng, Phường 2', 'Phường 2, Thanh Xuân, Hà Nội', 'sell', '[\"https://picsum.photos/800/600?random=131\",\"https://picsum.photos/800/600?random=132\",\"https://picsum.photos/800/600?random=133\"]', 'approved', 'Đã bàn giao', 1, 1086, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (15, 'Cho thuê Chung cư tại Lê Duẩn, Gia Lâm', 'Vobis velum thesis cervus qui decet optio. Capillus caveo defluo enim coniuratio unus sopor. Thesis uredo neque comparo cruentus vulgaris arx suspendo. Vị trí đắc địa, gần công viên. Cupiditas molestiae cimentarius caritas cuppedia decor. Illo tego solium taedium deludo contra atrox alias.', '405 Lê Duẩn, Phường 2', 'Phường 2, Gia Lâm, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=141\",\"https://picsum.photos/800/600?random=142\",\"https://picsum.photos/800/600?random=143\"]', 'approved', 'Chưa bàn giao', 5, 1971, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
INSERT INTO `posts` VALUES (16, 'Bán Chung cư tại Trần Duy Hưng, Hai Bà Trưng', 'Conculco una numquam voro bos. Sufficio averto arcesso deleniti. Corpus tergiversatio coerceo crastinus tamisium. Vị trí đắc địa, gần bệnh viện. Vitium currus ulciscor vulnero. Distinctio tutis curatio deprecator triduana.', '233 Trần Duy Hưng, Phường 5', 'Phường 5, Hai Bà Trưng, Hà Nội', 'sell', '[\"https://picsum.photos/800/600?random=151\",\"https://picsum.photos/800/600?random=152\",\"https://picsum.photos/800/600?random=153\"]', 'pending', 'Chưa bàn giao', 1, 1987, 'user', '2025-12-27 14:14:13', '2025-12-27 14:14:13', 0, NULL);
