INSERT INTO `posts` VALUES (889, 'Cần cho thuê Chung cư tại Tôn Đức Thắng, Thanh Xuân', 'Sollicito cunae cupiditas commodo repellat tempora. Basium caste ulciscor thesaurus cenaculum ante deludo decipio addo creptio. Demulceo audacia surgo timidus. Vị trí đắc địa, gần trường học. Calculus acer patria carmen concedo quaerat varietas vehemens torrens. Adeo valeo torrens claudeo terga taceo delibero deduco vulnero arbor.', '7 Tôn Đức Thắng, Phường Láng Hạ', 'Phường Láng Hạ, Thanh Xuân, Hà Nội', 'rent', '[\"https://picsum.photos/800/600?random=8881\",\"https://picsum.photos/800/600?random=8882\",\"https://picsum.photos/800/600?random=8883\"]', 'approved', 'Đã bàn giao', 1, 1343, 'user', '2025-12-27 14:14:15', '2025-12-27 14:14:15', 0, NULL);
